import React from 'react';
import ReactDOM from 'react-dom';
import App from './App';

const store = createStore(reducer, state);
const context = React.createContext(undefined);
ReactDOM.render(
  <Provider store={store} context={context}>
  <App />
    </Provider>,
  document.getElementById('root')
);
